INSERT INTO `tbl_email_template` (`tplid`, `tplshortname`, `tplsubject`, `tplmessage`, `tplmailid`, `isactive`) VALUES
(3, 'Activate your  {COMPANY_NAME}account', 'Activate your  {COMPANY_NAME}account', '<p>Hello <strong>{NAME}</strong></p>\r\n\r\n<p>Thank you for registering with {company_name}</p>\r\n\r\n<p>Before we can complete your registration, we need to verify your e-mail address. Please click on the link below to complete your registration.</p>\r\n\r\n<p><a href="{SITE_PATH}user/access/{code}" target="_blank">{SITE_PATH}user/access/{code}</a></p>\r\n\r\n<p>If you have problems following the link, please copy and paste it into your browser to complete your registration.</p>\r\n\r\n<p>A request to create account was received from your {company_name} Account - {EMAIL} from the IP - {IP}</p>\r\n\r\n<p>Enjoy!<br />\r\n<strong>The </strong>{company_name}<strong> Team</strong><br />\r\n<br />\r\n<br />\r\nIf you have not initiated this request, send mail to {admin_email}<br />\r\nIf you have any query please send mail to {admin_email}<br />\r\nThis is an automated email, please don&#39;t reply.</p>', NULL, 0),
(10, 'Thanks for Contact Us', 'Thanks for Contact Us', '<p>Dear Admin,<br />\r\n<br />\r\nName: {Name}<br />\r\nEmail: {email}<br />\r\nPhone: {phone}<br />\r\nMessage:<br />\r\n<br />\r\n{message}<br />\r\n<br />\r\nRegards,<br />\r\n{company_name} Team</p>', NULL, 0),
(11, 'Feedback', 'Feedback', '<p>Dear Admin,<br />\r\n<br />\r\nName: {Name}<br />\r\nEmail: {email}<br />\r\nPhone: {phone}<br />\r\nFeedback:<br />\r\n<br />\r\n{message}<br />\r\n<br />\r\nPage: {page}<br />\r\nRating: {rating}<br />\r\nRegards,<br />\r\n{company_name} Team</p>', NULL, 0),
(12, 'Activate your  {COMPANY_NAME}account', 'Activate your  {COMPANY_NAME}account', '<p>Hello <strong>{NAME}</strong></p>\r\n\r\n<p>Thank you for registering with {company_name}</p>\r\n\r\n<p>Your Password is <strong>{PASSWORD}</strong></p>\r\n\r\n<p>A request to create account was received from your{company_name} - {EMAIL} from the IP - {IP}</p>\r\n\r\n<p>Enjoy!<br />\r\n<strong>The </strong>{company_name}<strong>Team</strong><br />\r\n<br />\r\n<br />\r\nIf you have not initiated this request, send mail to {admin_email}<br />\r\nIf you have any query please send mail to {admin_email}<br />\r\nThis is an automated email, please don&#39;t reply.</p>', NULL, 0),
(26, '{COMPANY_NAME}:Password changed', '{COMPANY_NAME}:Reset password-{EMAIL}', '<p>A request to reset password was received from your {company_name}- {EMAIL} from the IP - {IP}</p>\r\n\r\n<p>Your password has been reset to <strong> {PASSWORD} </strong></p>\r\n\r\n<p>Enjoy!<br />\r\n<strong>The {</strong>company_name<strong>} Team</strong><br />\r\n<br />\r\n<br />\r\nIf you have not initiated this request, send mail to {admin_email}<br />\r\nIf you have any query please send mail to {admin_email}<br />\r\nThis is an automated email, please don&#39;t reply.</p>', NULL, 0),
(2, 'Thank you for subscribe', 'Thank you for subscribe', '<p> Thank you for subscribe </p>', NULL, 0),
(28, '{COMPANY_NAME}:Trip enquiry', '{COMPANY_NAME}:Trip enquiry', '<p>Hello <strong>{NAME}</strong></p>\r\n\r\n<p>Passanger_name: <strong>{NAME}</strong></p>\r\n\r\n<p>Traveller_name: <strong>{PNAME}</strong></p>\r\n\r\n<p>Traveller_email: <strong>{PEMAIL}</strong></p>\r\n\r\n<p>Traveller_mobile: <strong>{PMOBILE}</strong></p>\r\n\r\n<p>Enjoy!<br />\r\n<strong>The {</strong>company_name<strong>}</strong><br />\r\n<br />\r\n&nbsp;</p>', NULL, 0),
